use anyhow::Context;
use base64::Engine;
use once_cell::sync::Lazy;
use regex::Regex;

use super::{ExtractFrom, ExtractedVideo, Extractor, SupportedFrom};

pub struct Voe;

impl Extractor for Voe {
    const DISPLAY_NAME: &'static str = "Voe";
    const NAMES: &'static [&'static str] = &["Voe"];

    fn supported_from() -> SupportedFrom {
        SupportedFrom::all()
    }

    async fn supports_url(_url: &str) -> Option<bool> {
        None
    }

    async fn extract_video_url(from: ExtractFrom) -> Result<ExtractedVideo, anyhow::Error> {
        static REDIRECT_REGEX: Lazy<Regex> =
            Lazy::new(|| Regex::new(r#"window\.location\.href *= *(?:'([^']+)'|"([^"]+)") *;"#).unwrap());

        let (user_agent, referer) = match &from {
            ExtractFrom::Url {
                url: _,
                user_agent,
                referer,
            } => (user_agent.clone(), referer.clone()),
            ExtractFrom::Source(_) => (None, None),
        };
        let mut source = from.get_source(None).await?;

        if let Some(redirect_url) = REDIRECT_REGEX
            .captures(&source)
            .and_then(|captures| captures.get(1).or_else(|| captures.get(2)))
        {
            source = ExtractFrom::Url {
                url: redirect_url.as_str().to_string(),
                user_agent,
                referer,
            }
            .get_source(None)
            .await?;
        }

        Self::extract1(&source)
            .or_else(|_| Self::extract2(&source))
            .or_else(|_| Self::extract3(&source))
    }
}

impl Voe {
    fn extract1(source: &str) -> Result<ExtractedVideo, anyhow::Error> {
        static VIDEO_URL_REGEX: Lazy<Regex> = Lazy::new(|| Regex::new(r#"'hls': '([^']+)'"#).unwrap());

        VIDEO_URL_REGEX
            .captures(source)
            .and_then(|captures| captures.get(1))
            .map(|video_url| {
                let url = base64::prelude::BASE64_STANDARD
                    .decode(video_url.as_str())
                    .ok()
                    .and_then(|decoded_url| String::from_utf8(decoded_url).ok())
                    .unwrap_or_else(|| video_url.as_str().to_string());

                ExtractedVideo { url, referer: None }
            })
            .context("Voe: failed to retrieve sources")
    }

    fn extract2(source: &str) -> Result<ExtractedVideo, anyhow::Error> {
        static VIDEO_URL_REGEX: Lazy<Regex> = Lazy::new(|| {
            Regex::new(
                r#"let \w+ = '((?:[A-Za-z0-9+/]{4})*(?:[A-Za-z0-9+/]{4}|[A-Za-z0-9+/]{3}=|[A-Za-z0-9+/]{2}={2}))';"#,
            )
            .unwrap()
        });

        VIDEO_URL_REGEX
            .captures(source)
            .and_then(|captures| captures.get(1))
            .and_then(|capture| {
                base64::prelude::BASE64_STANDARD
                    .decode(capture.as_str())
                    .ok()
                    .map(|mut reversed_json| {
                        reversed_json.reverse();
                        reversed_json
                    })
            })
            .and_then(|json_text| serde_json::from_slice::<serde_json::value::Value>(&json_text).ok())
            .and_then(|json| {
                json.as_object()
                    .and_then(|json_object| json_object.get("file"))
                    .and_then(|json_file| json_file.as_str().map(|s| s.to_string()))
            })
            .map(|video_url| ExtractedVideo {
                url: video_url,
                referer: None,
            })
            .context("Voe: failed to retrieve sources")
    }

    fn extract3(source: &str) -> Result<ExtractedVideo, anyhow::Error> {
        static VIDEO_URL_REGEX: Lazy<Regex> = Lazy::new(|| {
            Regex::new(r#"'((?:[A-Za-z0-9+/=_]|@\$|\^\^|~@|%\?|\*~|!!|#&)+)'|"((?:[A-Za-z0-9+/=_]|@\$|\^\^|~@|%\?|\*~|!!|#&)+)""#).unwrap()
        });

        fn rot13(input: &str) -> Result<String, std::string::FromUtf8Error> {
            String::from_utf8(
                input
                    .bytes()
                    .map(|c| match c {
                        b'A'..=b'Z' => ((c - b'A' + 13) % 26) + b'A',
                        b'a'..=b'z' => ((c - b'a' + 13) % 26) + b'a',
                        _ => c,
                    })
                    .collect::<Vec<_>>(),
            )
        }

        fn clean_symbols(input: String) -> String {
            let patterns = ["@$", "^^", "~@", "%?", "*~", "!!", "#&"];
            let mut result = input;
            for pattern in patterns.iter() {
                result = result.replace(pattern, "_");
            }
            result
        }

        fn shift_chars(input: &str, shift: i32) -> Result<String, std::string::FromUtf16Error> {
            String::from_utf16(
                &input
                    .encode_utf16()
                    .map(|code_unit| (code_unit as i32 - shift).rem_euclid(65536) as u16)
                    .collect::<Vec<_>>(),
            )
        }

        fn decode(input: &str) -> Option<String> {
            let step1 = rot13(input).ok()?;
            let step2 = clean_symbols(step1);
            let step3 = step2.replace("_", "");
            let step4 = String::from_utf8(base64::prelude::BASE64_STANDARD.decode(&step3).ok()?).ok()?;
            let step5 = shift_chars(&step4, 3).ok()?;
            let step6: String = step5.chars().rev().collect();
            let step7 = String::from_utf8(base64::prelude::BASE64_STANDARD.decode(&step6).ok()?).ok()?;
            let json: serde_json::Value = serde_json::from_str(&step7).ok()?;
            json.get("source").and_then(|v| v.as_str().map(|s| s.to_string()))
        }

        for captures in VIDEO_URL_REGEX.captures_iter(source) {
            let Some(group) = captures.get(1).or_else(|| captures.get(2)) else {
                continue;
            };

            let Some(video_url) = decode(group.as_str()) else {
                continue;
            };

            return Ok(ExtractedVideo {
                url: video_url,
                referer: None,
            });
        }

        anyhow::bail!("Voe: failed to retrieve sources");
    }
}

